      cardImage,
      cardRare,
      cardTrunfo,
    } = this.props;
    return (
      <article>
        <section data-testid="name-card">{ cardName }</section>
        <img src={ cardImage } alt={ cardName } data-testid="image-card" />
        <section data-testid="description-card">{} </section>
      </article>
    );
  }
}
